import "./scss/app.scss";
import Home from "./components/Home";
import { Route, Routes } from "react-router-dom";
import OneMedicineBlock from "./pages/OneMedicineBlock/OneMedicineBlock";
import Header from "./components/Header";
import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Cart from "./pages/Cart/Cart";
import {useDispatch, useSelector} from "react-redux";
import ModalOkno from "./components/ModalOkno/ModalOkno";

function App() {
    const selectedMedicine = useSelector(state => state.filter.modalOkno)

  return (
    <>
      <div className="wrapper">
        <Header />
          {selectedMedicine && <ModalOkno selectedMedicine={selectedMedicine}/>}
        <Routes>
          <Route path="/" element={<Home />} />
          {/*<Route path="/medicine/:id" element={<OneMedicineBlock />} />*/}
          <Route path="/cart" element={<Cart />} />
        </Routes>
      </div>
    </>
  );
}

export default App;
